import React from 'react';

class Menu extends React.Component {
    cliquei = (components) => {
        console.log (components)
    }

    render(){
        return(
            <div>
                <p>&#9776;</p>
                {this.props.components.map(imagem => {
                    return(
                        <p onClick={() => this.cliquei(components)}>{imagem}</p>
                    )
                })}
            </div>
        )

    }
}
export default Menu;
